import {React , useEffect, useState} from 'react';

function T(){
   const [x , setx] = useState([])

    useEffect(()=>{
        axios.get("https://lklkl./posts")
        .then((response)=> {setx(response.data)})
        .catch((error)=>{
            console.log(error)
        })
    }
    )

    return(
        <section >
           <ul>
            {x.map((post)=> (
                <li></li>
            ))}
           </ul>
        </section>
        
    )
}
export default T ;
